import styles from "./BotaoPrincipal.module.css"
import { useNavigate } from "react-router-dom";

const BotaoEditar = ({children, tamanho, destino}) => {
    return (
        <button className={`
            ${styles.botaoPrincipal}
            ${styles[tamanho]}`}>
            {Navigate}
            {children}
        </button>
    )
}

export default BotaoEditar
